package com.getUserInfo;

public class UserInfo {

	private Integer ID;
	private String username;
	private String IP;
	private Double Local_longitude;
	private Double Local_latitude;
	private String Name;
	private String Phone;
	private String Sex;
	
	public UserInfo() {
		// TODO Auto-generated constructor stub
	}

	

	public Integer getID() {
		return ID;
	}



	public void setID(Integer iD) {
		ID = iD;
	}



	public String getUsername() {
		return username;
	}

	public void setUsername(String username) {
		this.username = username;
	}

	public String getIP() {
		return IP;
	}

	public void setIP(String iP) {
		IP = iP;
	}

	public Double getLocal_longitude() {
		return Local_longitude;
	}

	public void setLocal_longitude(Double local_longitude) {
		Local_longitude = local_longitude;
	}

	public Double getLocal_latitude() {
		return Local_latitude;
	}

	public void setLocal_latitude(Double local_latitude) {
		Local_latitude = local_latitude;
	}

	public String getName() {
		return Name;
	}

	public void setName(String name) {
		Name = name;
	}

	public String getPhone() {
		return Phone;
	}

	public void setPhone(String phone) {
		Phone = phone;
	}

	public String getSex() {
		return Sex;
	}

	public void setSex(String sex) {
		Sex = sex;
	}

	
	
}
